// src/pages/SurfaceSelection.js
import React from 'react';
import SearchBar from '../Components/SearchBar';
import styled from 'styled-components';

// Container to center the content with shadow
const PageContainer = styled.div`
  display: flex;
  flex-direction: column;
  align-items: center;
  justify-content: center;
  min-height: 70vh;
  text-align: center; /* Center text and other elements */
  background: #fff;
  border-radius: 10px;
  box-shadow: 0 4px 6px rgba(0, 0, 0, 0.9);
  padding: 2rem; /* Add some padding if needed */
`;

const SurfaceSelection = () => {
  return (
    <PageContainer>
      <SearchBar />
      <h1>Surface Selection</h1>
      <p>Select surfaces for your application and explore available options here.</p>
    </PageContainer>
  );
}

export default SurfaceSelection;
